import React, {useState} from 'react';
import About from './Components/About';
import Home from './Components/Home';
import Contact from './Components/Contact';
const App = () => {
  var [about,setAbout]= useState(false);
  const aboutpage = () => {
    setAbout(!about);
  };

  var [contact,setContact]= useState(false);
  const contactpage = () => {
    setContact(!about);
  };

  function Refresh() {
    window.location.reload(false);
  }

    if (about) {
      return(
        <div>
          <About/>
          <button onClick={<Refresh/>}>CLick me to go back</button>
        </div>
      )
    }

    if (contact) {
      return(
        <div>
          <Contact/>
          <button onClick={<Refresh/>}>CLick me to go back</button>
        </div>
      )
    }


    return(
      <div>
        <Home/>
        <button onClick={aboutpage}>About</button>
        <button onClick={contactpage}>Contact</button>
      </div>
    )
}

export default App;
